[{"location":"reference/#Reference-Guide","page":"Reference","title":"Reference Guide","text":"","category":"section"},{"location":"reference/","page":"Reference","title":"Reference","text":"Model\nadd!\nset_value\nset_fixed!\nParameter\nSector","category":"page"},{"location":"reference/#MPSGE.Model","page":"Reference","title":"MPSGE.Model","text":"Model()     The struct that stores all the elements of the model.\n\nExample\n\njulia> foo = Model()\n\n\n\n\n\n","category":"type"},{"location":"reference/#MPSGE.add!","page":"Reference","title":"MPSGE.add!","text":"add!(m,bar)\nFunction that adds an element to the model with a name assignment\nm::Model is always the first Argument\n\n# Options\nParameter::ScalarParameter, ::IndexedParameter\nCommodity::ScalarCommodity, ::IndexedCommodity\nSector::ScalarSector,       ::IndexedSector\nConsumer::ScalarConsumer,   ::IndexedConsumer\nAux::ScalarAux,             ::IndexedAux\n\nExample\n\njulia> S = add!(m, Sector())\n\nProduction::Production\nDemand::DemandFunction\nAuxConstraint::AuxConstraint\n\nExample\n\njulia> add!(m, Production()) \n\n\n\n\n\n","category":"function"},{"location":"reference/#JuMP.set_value","page":"Reference","title":"JuMP.set_value","text":"set_value(P, value::Float64)\nFunction that allows users to set a specific value for a variable, updating the benchmark field.\n\nOptions\n\nParameter::ScalarParameter, ::IndexedParameter\nCommodity::ScalarCommodity, ::IndexedCommodity\nSector::ScalarSector,       ::IndexedSector\nConsumer::ScalarConsumer,   ::IndexedConsumer\nAux::ScalarAux,             ::IndexedAux\n\nExample\n\njulia> set_value(var, 1.3)\n\n\n\n\n\n","category":"function"},{"location":"reference/#MPSGE.set_fixed!","page":"Reference","title":"MPSGE.set_fixed!","text":"set_fixed!(P, true::Boolean)\nFunction that allows users to fix a value for a variable, the benchmark, the value from set_value, or the previous value.\n\nOptions\n\nParameter::ScalarParameter, ::IndexedParameter\nCommodity::ScalarCommodity, ::IndexedCommodity\nSector::ScalarSector,       ::IndexedSector\nConsumer::ScalarConsumer,   ::IndexedConsumer\nAux::ScalarAux,             ::IndexedAux\n\nExample\n\njulia> set_value(var, false)\n\n\n\n\n\n","category":"function"},{"location":"reference/#MPSGE.Parameter","page":"Reference","title":"MPSGE.Parameter","text":"Parameter(:symbol; indices, value::Float64=1., string)\nStruct that holds the name, indices if IndexedParameter, value, and optional description of a parameter within the model.\n\nOptions\n\nParameter::ScalarParameter, IndexedParameter\n\nExample\n\njulia> P = add!(Parameter(model, :P, value=1., description=\"Elasticity\"))\njulia> sectors = [:s1, :s2]\njulia> P = add!(Parameter(model, :P, indices=(,sectors), value=1., description=\"Elasticity parameters for X Sector \"))\n\n\n\n\n\n","category":"type"},{"location":"reference/#MPSGE.Sector","page":"Reference","title":"MPSGE.Sector","text":"Sector(:symbol; indices, value::Float64=1., string)\nStruct that holds the name, (indices if IndexedSector), value, and optional description of a sector within the model.\n\nOptions\n\nSector::ScalarSector, IndexedSector\n\nExample\n\njulia> S = add!(Sector(model, :S, value=1., description=\"Sector S\"))\njulia> sectors = [:s1, :s2]\njulia> P = add!(Sector(model, :S, indices=(,sectors), value=1., description=\"S[:s1] and S[:s2] Sectors\"))\n\n\n\n\n\n","category":"type"},{"location":"#MPSGE.jl","page":"Home","title":"MPSGE.jl","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"MPSGE.jl is a Julia evolution of the GAMS MPSGE subsystem MPSGE","category":"page"},{"location":"","page":"Home","title":"Home","text":"The Documentation for MPSGE should be useful to reference, especially for background, theory, and for some understanding of features while the MPSGE.jl is still being written.","category":"page"},{"location":"","page":"Home","title":"Home","text":"The documentation here will probably grow in fits and starts. Please give us feedback as we go and let us know what would be especially helpful.","category":"page"}]
